import React, { FC, useState } from 'react';
import { v4 as uuid } from 'uuid';

import { USERS_HEADER } from './constants';

import Pagination from '../../components/shared/Pagination';

import useUsers from '../../hooks/useUsers';

import style from '../authentication/login/Login.module.scss';

const Users: FC = () => {
  const [activePage, setActivePage] = useState<number>(1);
  const [users, totalNumberOfPages] = useUsers(activePage);

  const onPageChange = (selectedItem: { selected: number }): void => {
    setActivePage(selectedItem.selected);
  };

  return (
    <>
      <table>
        <thead>
          <tr>
            {USERS_HEADER.map((label) => (
              <th key={uuid()}>{label}</th>
            ))}
          </tr>
        </thead>
        <tbody>
        {users.length ? users.map((user) => (
            <tr key={uuid()}>
              {Object.keys(user).map((key) =>
                {<td key={uuid()}>{ user[`${key}`] }</td>}
              )}
            </tr>
          ))
          : <tr>
            <td>
              No result
            </td>
          </tr>}
        </tbody>
      </table>
      <button className={style.authBtn} type="button">
        Add new user
      </button>
      <Pagination
        totalNumberOfPages={totalNumberOfPages}
        size={10}
        page={activePage}
        onPageChange={onPageChange}
      />
    </>
  );
};

export default Users;
